import React from 'react';
import { Route, BrowserRouter as Router, Switch } from 'react-router-dom';
import Header from './Header';
import Sidebar from './Sidebar';

const Dashboard = () => <div className="p-3">Dashboard Content</div>;
const UserGroup = () => <div className="p-3">User Group Content</div>;
const Messages = () => <div className="p-3">Messages Content</div>;

const AdminLayout = () => {
  return (
    <Router>
      <div className="container-fluid">
        <div className="row">
          {/* Sidebar */}
          <div className="col-md-3">
            <Sidebar />
          </div>
          
          {/* Main Content */}
          <div className="col-md-9">
            <Header />
            <div className="container-fluid">
              <Switch>
                <Route path="/dashboard" component={Dashboard} />
                <Route path="/user-group" component={UserGroup} />
                <Route path="/messages" component={Messages} />
              </Switch>
            </div>
          </div>
        </div>
      </div>
    </Router>
  );
};

export default AdminLayout;
